import React, { Component } from 'react'
import styled from 'styled-components'
import { FlexboxCenter } from '../StyledCom/flexbox.js'

const TestProps = (props) => {
    return(
        <div style={{
            height: "50px",
            width: "100%"
        }}>
        <span style={{
            C: "#FFFFFF"
        }}>
            test
        </span>
        </div>
    );
}

export default TestProps;
